T~L~970~-470~0~#000000~monospace~~~~~comment~/*
  S1 = 0, S0 = 0 : Hold
  S1 = 1, S0 = 1 : Load
  S1 = 0, S0 = 1 : Shift 
*/

S1      = CS & WR & !A0 ;
S0      = RUN # S1 ;
SD_SCK  = RUN & !CLK2 ;

sequence SD_CS
{
  present 'b'0
    if RESET next 'b'0 ;
    /* writing D0 = 1 sets SD_CS = 1 */
    if CS & WR & A0:1 & D0:1 next 'b'1 ;
    default next 'b'0 ;
  present 'b'1
    if RESET next 'b'0 ;
    /* writing D0 = 0 sets SD_CS = 0 */
    if CS & WR & A0:1 & D0:0 next 'b'0 ;
    default next 'b'1 ;
}~1~start~gge60678~0~pinpart
